import React from 'react';

const Lang = () => {

    const db="{[language:english,count:5]}"

    function find(){
        return alert("hello")
    }

    return (
        <div>
            <div className="body">
                <br/>
                <div className="box">
                    <input type="text" placeholder="Your Text Here..." required autocomplete="off"/><br/>
                    <button type="submit" onclick={find()}>Find</button>
                </div>
                <h4>Trending language searches...</h4>
                <pre>{db}</pre>
            </div>
        </div>
    )
}

export default Lang;
